('node', 'article', 0, 1, 1, 'und', 0, 'Node (Content)\r\nNode merupakan isi dari sebuah website yang dibangun menggunakan Drupal. Jenis isi website bisa bervariasi seperti : blog, topik forum, gambar, dan artikel. Sebagai contoh, apabila kita membuat website Berita Online, maka berita, foto galeri, forum diskusi, poling disebut Node.\r\n\r\nEntity type \r\nIstilah ini sering digunakan sejak Drupal 7. Entity type semacam wadah untuk menggabungkan beberapa field. Entity type berguna untuk menyimpan dan menampilkan data yang bisa berupa node, taxonomy term, user profile atau jenis custom content lainnya.\r\n\r\nComment\r\nComment salah satu jenis content type bawaan dari Drupal. Setiap comment berupa posting tulisan dari user yang tergabung dalam sebuah Node. Sebagai contoh, user dapat memposting comment di sebuah topik forum.\r\n\r\nTaxonomy \r\nTaxonomy merupakan sistem pembagian jenis konten website. Module Taxonomy merupakan bawaan dari Drupal. Anda dapat menentukan Vocabulary (wadah dari Taxonomy term) dan menambahkan sejumlah Term di Vocabulary. Setiap vocabulary dapat dipasangkan pada Content Type, sehingga Node dapat dikelompokkan per kategori sesuai keinginan anda. Contoh : Sebuah portal berita, anda dapat membuat Vocabulary : Topik Berita, kemudian dalam Vocabulary Topik Berita tersebut dapat diisi Term : Politik, Olahraga, Teknologi, dst.\r\nSelanjutnya dalam Entity type Berita, dapat ditambahkan Vocabulary Topik Berita, sehingga pada saat kita memposting sebuah berita, kita dapat memilih berita tersebut masuk dalam kategori Politik / Olahraga / Teknologi.\r\n\r\nUser\r\nUser merupakan entity yang mewakili pengguna website. Setting awal, user terdiri dari username, password, role, dan alamat email. Tetapi kita dapat menambahkan field baru dengan mengaktifkan modul tambahan. Seperti menambahkan link Social Network FB/Twitter.\r\n\r\nModule\r\nModule adalah kode program yang melengkapi fungsi dari Drupal. Module terdiri dari 3 kategori : \r\n•	Core module adalam module bawaan pada waktu kita mendownload Drupal. Seperti : Blog, Poll, Book, atau Taxonomy.\r\n•	Contributed module adalah module yang dikembangkan dan dibuat oleh komunitas Drupal, kita dapat mendownload dan meng-install di website kita seperti : Panel, Views, Pathauto.\r\n•	Custom module bagi anda yang sudah terbiasa menggunakan bahasa pemrograman, dan mengerti alur dari Drupal dan Drupal API.\r\n\r\nRegion\r\nHalaman website Drupal disusun dalam area yang disebut Region. Didalamnya terdapat header, footer, sidebar, dan main-content. Selain itu anda dapat menambahkan region sesuai kebutuhan website anda.\r\n\r\nBlock \r\nBlock adalah bagian-bagian kecil informasi yang diletakkan dalam Region. Block dapat berisi berbagai macam konten, seperti form, tulisan, gambar, dan script. Selain itu block juga bisa berupa bagian dari module seperti Most Comment Block dari module Comment, Who''s Online Block dari core module Drupal, New Topic Block dari module Forum. Block juga dapat menampilkan konten yang dinamis, seperti Upcoming Event, Top Score.\r\n\r\nMenu\r\nMenu berguna untuk mengarahkan user ke konten website, terdapat 4 jenis menu di Drupal 7:\r\n•	Main menu dibuat oleh administrator dan ditampilkan secara otomatis di header website, apabila tidak tampil, bisa anda aktifkan di block.\r\n•	Management menu adalah menu untuk administrasi website, ditampilkan di toolbar admin\r\n•	Navigation menu berisi semua link menu yang berhubungan dengan module di website anda\r\n•	User menu berisi link ke user account dan logout \r\nSelain keempat menu tersebut, anda dapat membuat menu baru, dan menampilkannya di region yang anda inginkan. \r\nAnda dapat mengkustomisasi menu dengan berbagai cara, seperti mengurutkan, mengubah nama menu, mengganti link menu dan tooltip menu. Selain itu juga dapat mengatur Parent pada menu item. Menu juga memiliki hak akses, seperti contoh: admin menu hanya bisa dilihat oleh administrator, bukan oleh user biasa.\r\n\r\nTheme\r\nThema mengatur tampilan di website anda, bagaimana design website anda akan tampil, seperti tampilan gambar, layout dan warna. Theme terdiri dari beberapa file PHP yang akan menampilkan output HTML di halaman website, beserta file CSS yang mengatur layout, font, warna dan style lainnya. Theme dapat diubah-ubah dengan memilih theme yang tersedia dalam direktori /themes maupun /sites/all/themes.\r\n\r\nViews\r\nMeskipun tidak semua website menggunakan module views, tetapi hampir sebagian besar website menyertakan Views module karena fungsinya yang sangat pengint. Views dapat mengambil list node, atau entity kemudian menampilkannya dalam berbagai bentuk format: halaman, block, RSS Feed, atau format lainnya. Kegunaan utama dari views adalah mengambil dan menampilkan content list secara dinamis, seperti contoh: Latest News di portal berita.\r\n\r\nDatabase\r\nDatabase sebagai media penyompan informasi. Dengan database setiap informasi ditampung dalam table. Sebagai contoh, informasi yang anda posting dalam node akan tersimpan dalam table node, dan setiap fieldnya tersimpan dalam table yang terpisah (Drupal membuatnya secara otomatis). Comment dan user juga memiliki table tersendiri, sesuai role dan permissionnya. Database yang paling umum digunakan di Drupal adalah MySQl, meskipun Drupal juga mendukung system database yang lain.\r\n\r\nPath\r\nSaat anda mengunjungi website Drupal, alamat URL website itu yang dinamakan path. Secara umum Drupal menggunakan format ''namadomain.com/node/1''. Selain itu kita dapat menggunakan module tambahan seperti pathauto untuk mengubah format URL sesuai format yang kita inginkan. URL menggunakan pathauto mudah dibaca dan sangat efektif.\r\n\r\nHook\r\nUser tidak pernah menyadari keberadaan konsep ini dalam Drupal, kecuali mereka adalah developer. Hook adalah metoda yang digunakan Drupal agar setiap modul dapat menambahkan fungsi tertentu, dengan cara mengaitkan fungsi tertentu tersebut pada hook yang dimiliki sistem Drupal. Sebagai contoh: setiap modul dapat menambah menu baru dengan cara mendefinisikan fungsi modul_menu, yang akan menjamin Drupal tidak lupa memperhitungkan keberadaan menu tersebut ketika diperlukan.\r\n\r\nAdminister\r\nTempat pengaturan semua fungsi kerja Drupal\r\n\r\nInput Format\r\n(Text format untuk versi D7) menu untuk mengatur format dari teks html yang akan kita tampilkan pada konten/node.\r\n\r\nPermissions \r\nHak akses yang dimiliki user/roles untuk membatasi kewenangan aksi terhadapsuatu konten, modul, tema atau fungsi situs lainnya.\r\n\r\nRoles \r\nKelompok user yang mempunyai permission yang sama.\r\n\r\nContent Type\r\n•	Book\r\n•	Page\r\n•	Blog\r\n•	Story\r\n•	Forum\r\n\r\nBody \r\nIsi dari konten secara full\r\n\r\nTeaser \r\nIsi ringkasan dari konten, biasanya diambil sejumlah xxx karakter dari isi awal konten. Dengan xxx panjang karakternya misalnya 300, 400, 900. Dan nilau defaultnya adalah 600.\r\n\r\nField\r\nField adalah bagian dari suatu struktur content tempat menyimpan suatu data. Data yang disimpan ini bisa berupa tulisan, angka, image, audio atau video. Setiap jenis content pada Drupal memiliki jumlah field dan jenis data yang berbeda-beda bahkan bisa dikembangkan sesuai dengan kebutuhan kita.\r\n', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, 'KELEBIHAN DRUPAL\r\n\r\n1. Drupal bersifat open source. yang bisa digunakan secara personal maupun group untuk mengatur berbagai jenis content. Drupal dapat digunakan sebagai web portal, situs diskusi, situs perusahaan, bahkan blog dan aplikasi e-commerce. Drupal memiliki fungsi bulit-in dan modul-modul eksternal yang dapat langsung di-download gratis dari situsnya.\r\n\r\n2. Drupal didesain sebagai sebuah publishing system cms. Kelebihan Drupal terutama dalam hal taksonomi. Taksonomi adalah ilmu tentang klasifikasi yang dalam hal ini berarti pengklasifikasian content yang bagus dalam sebuah website. Konsep taxonomy dalam Drupal terkenal sangat flekzibel dan powerfull ditambah dengan konsep node, dimana setiap node dapat berupa pages, stories, blog item, files, atau apapun yg berhubungan dgn konten itu sendiri. Inilah alasan kenapa Drupal sangat cocok dan tepat digunakan untuk situs2 yang mengandalkan konten sebagai nilai jual dan pengelompokan artikel yg komplek, seperti situs portal berita, artikel, knowledgebase, kolaborasi, dsb.\r\n\r\n3. Drupal memiliki dua konsep perkembangan yaitu Modular dan Extensible. Drupal menggunakan System Block atau Module yang dapat menambah fitur dari sebuah website. Drupal juga men-support standard programming seperti CSS dan XHTML.\r\n\r\n4. Dukungan Database. Drupal meminimalisasikan query database dan penggunaan resource, juga memperluas persyaratan server sehingga mempermudah penginstallan. Drupal dapat beroperasi pada server yang menggunakan Apache Server, platform PHP dan MySQL/PostgreSQL database. Meski demikian Drupal menyediakan path freeware untuk menjalankan Drupal dengan menggunakan MS SQL.\r\n\r\n5. Kemudahan Instalasi. Drupal sudah menyediakan instalasi dengan menggunakan Fantastico. Untuk instlasi manual memang agak repot karena kita harus membuat databasenya terlebih dahulu selain itu untuk proses create tabel-tabelnya juga harus dijalankan secara manual. Tapi ini hanya berlaku di Drupal versi 4, sedangkan Drupal 5.0 sudah menggunakan Web Based Installation, sama seperti Joomla atau Mambo.\r\n\r\n6. Search Engine Frendly (SEF). Issue kedua yang penting adalah kemampuan website membuat link yang mudah dibaca dan cepat dikenali oleh search engine sehingga website anda dapat menempati urutan atas dari hasil pencarian searh engine. Pada Drupal, user dimungkinkan untuk mengubah nama link SEF sehingga dapat lebih mengenai sasaran. Itulah sebabnya mengapa website berbasis Drupal dapat menempati urutan atas search engine.\r\n\r\n7. Access Control List (ACL) Pada Drupal, secara default hanya menyediakan 2 ACL saja, yaitu: Anonymous dan Authenticated. Sedangkan account Administrator otomatis mempunyai hak administrator secara penuh (Super Admin). Namun ACL pada Drupal dapat ditambahkan sebanyak-banyaknya, jadi anda dapat membuat Group Moderator, IT atau Editorial. Dan masing-masing User boleh memiliki lebih dari 1 Group!\r\n\r\n8. Cache Memory. Cache memory pada CMS adalah kemampuan CMS untuk menyimpan secara dinamis halaman website yang telah dibuka, dengan demikian tidak perlu melakukan Query ulang pada database tetapi cukup 1 Query saja. Cache pada Drupal mampu meningkatkan kecepatan website menjadi 508%.\r\n\r\n9. Fasilitas dan feature Lengkap.\r\n    a. BLOG\r\n        Drupal menyediakan Blog dalam pengertian Weblog yang sesungguhnya. Pengertian Blog pada Drupal sama dengan yang ada di WordPress maupun Revolution2.\r\n    b. Multisite\r\n        Multisite adalah kemampuan CMS untuk membuat website induk yang terdiri atas beberapa website anak. Sehingga jika perlu upgrade maka cukup induknya saja yang diupgrade. Ini berguna sekali untuk membangun website komunitas di mana masing-masing anggota mempunyai website-nya sendiri, menarik bukan? Fasilitas Multisite hanya terdapat di Drupal.\r\n    c. Personalisasi Data Anggota\r\n        Hal ini juga sering ditanyakan, bagaimana caranya menambah field Tanggal Lahir, Alamat, Kota, Nomor KTP dan sejenisnya? Pada Drupal fasilitas ini sudah tersedia, bahkan anda dapat membuat agar isian user berupa text, checkbox, list, multiline, freeform list, URL atau data tanggal. Drupal secara default dapat menampilkan foto anggota yang dikenal dengan istilah avatar.\r\n    d. Forum Diskusi Dan Komentar\r\n        Baik Forum maupun Komentar tersedia secara langsung di Drupal.\r\n    e. Melihat Arsip Berbentuk Kalendar\r\n        Melihat arsip berbentuk daftar adalah hal biasa, umumnya peserta menginginkan agar arsip dapat dilihat dalam bentuk kalendar. Drupal menyediakan arsip dalam bentuk kalendar secara default sedangkan Joomla memerlukan komponen tambahan dari pihak ketiga.\r\n     f. WYSIWYG Editor\r\n        Secara defauld Drupal tidak dilengkapi dengan built-in WYSIWYG Editor, dengan alasan untuk lebih memberi kebebasan kita memilih WYSIWYG Editor yang sesuai dengan kebutuhan. Anda bisa menginstal module TinyMCE atau yang lebih canggih, misalnya FCKEditor.\r\n     g. Tracker\r\n         Tracker adalah kemampuan CMS untuk menampilkan apa saja yang pernah ditulis atau dikirim oleh user tertentu. Pada website ini jika anda klik “Tracker” maka akan ditampilkan semua blog, artikel, forum, maupun komentar yang pernah anda tulis. Drupal memiliki fungsi tracker secara default.\r\n     h. Online Shop\r\n         Drupal memiliki komponen atau modul tambahan untuk Online Shop dengan kemampuan yang baik.\r\nDitulis dengan bahasa PHP. Drupal jalan di atas berbagai sistem operasi Microsoft Windows, Mac OS X, Linux, FreeBSD dan lain-lain yang mendukung server web Apache atau IIS dan membutuhkan program database seperti MySQL dan PostgreSQL untuk menyimpan semua datanya.\r\n\r\nKEKURANGAN DRUPAL\r\n\r\n1.	Bukan CMS yang baik untuk dijadikan bahan pembelajaran membuat template pada CMS. Karena tidak “Designer Friendly”.\r\n\r\n2.	Untuk melakukan setup pada server, memerlukan lebih banyak waktu dan pengetahuan dibandingkan dengan wordpress ataupun joomla. Oleh karena itu, uang yang dikeluarkan juga pastinya lebih banyak .\r\n', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Modul drupal terbagi menjadi 4 jenis sesuai fungsi dan manfaatnya guna optimasi SEO drupal, optimasi security drupal, optimasi design dan tampilan serta modul pelengkap core (modul bawaan). Drupal adalah salah satu CMS yang lengkap dan multi fungsi, namun bukan berarti CMS ini sudah sempurna. Pada kenyataannya, CMS ini harus memasang modul tambahan, dan sebaliknya menonaktifkan module yang tidak diperlukan. Penting untuk diingat, salah satu bagian dari optimasi website berbasis drupal adalah bijaksana. Artinya hanya memakai module dan resource yang diperlukan dan membuang yang kurang bermanfaat. Aplikasi nyatanya adalah jika Anda tidak akan menggunakan forum di situs drupal Anda maka tidak ada untungnya memasang modul tersebut. Anda juga dapat mempertimbangkan modul-modul seperti OpenID, books, Testing, overlay, blog dan lain-lain. \r\n\r\nBerikut adalah 4 tipe modul penting drupal yang perlu Anda pakai dan kegunaannya.\r\n\r\n1. Modul Basic\r\n    Modul basic atau modul dasar yang saya maksudkan di sini adalah selain module core tapi memiliki fungsi dan kegunaan yang sangat besar serta menyempurnakan mesin drupal.\r\n    •	Views\r\n        Ini adalah salah satu modul drupal terbaik, memiliki kemampuan untuk membuat list dan query custom dari database. Views juga menyempurnakan modul bawaan seperti taxonomy term, glosary, tracker, users dan lain-lain. Lebih dari itu views dapat digunakan untuk membuat content custom, salah satu content yang paling populer adalah Views slideshow.\r\n    •	Ctools (Chaos Tools) \r\n        Paket modul oleh Merlin of chaos  yang dibutuhkan oleh begitu banyak modul agar berjalan seperti oleh views, meta tags, quick tabs, bulk export dan lain-lain.\r\n    •	CCK\r\n        Pada dasarnya adalah modul miscelleneous (serba-serbi), tapi faktany user interface token API dan memudahkan kita melihat semua daftar token dari database yang dipakai situs kita. Jelas ini akan mempermudah kita dalam membuat dan mengenali field dalam database \r\n    •	Libraries\r\n        Memungkinkan menggunakan library external non core seperti dalam memberikan efek pada slideshow (cycle) dan superfish.\r\n\r\n2. Modul Design dan Tampilan Drupal\r\n    •	Quick tabs\r\n        Modul ini memungkinkan kita memasukan berbagai konten dengan tampilan tabs, dilengkapi style yang beragam dan juga ajax (pindah tab tanpa reload).\r\n    •	Super Fish\r\n        Digunakan untuk mempercantik tampilan menu dengan jQuery, misalnya menampilkan menu utama yang menampilkan submenu ketika hover (mouse didekatkan).\r\n    •	Imageapi\r\n        Modul toolkit gambar yang memungkinkan kita membuat style, ukuran (dimensi), autocropping dan lain-lain dengan aturan yang dapat kita sesuaikan.\r\n    •	WYSIWYG\r\n        What You See is What You Get mempermudah kita dalam membuat content dengan tool writing dan coding HTML atau PHP dengan fitur autoparse. Artinya kita dapat menulis semudah mengetik di Microsoft Word, selain itu juga terdapat smiley sehingga tidak perlu lagi menambahkan modul smiley tambahan lagi.\r\n\r\n3. Modul Security / Keamanan Drupal\r\n    •	Security review\r\n        Modul ini tidak memberi proteksi langsung tapi hanya memberi review keamanan website kita, menunjukkan apa saja yang masih rentan dieksploitasi. Anda dapat meng-uninstall modul ini jika dirasa sudah benar-benar secure.\r\n    •	Login Security\r\n        Memungkinkan kita membatasi jumlah login yang gagal (login paksa)  dan tindakan jika batas itu terpenuhi, seperti blok IP sementara atau permanen, dan bisa juga memberi kita laporan jika serangan atau eksploitasi terjadi.\r\n    •	ACL\r\n        Modul ini tidak punya user interface tapi punya API (application programming interface) bagi modul lain untuk membuat daftar user dan izinnya untuk mengakses node tertentu.\r\n    •	Mollom\r\n        Adalah modul serupa plugin akismet di wordpress, menurut saya ini adalah modul penangkal spam terbaik yang dimiliki drupal.\r\n    •	Captcha dan Recaptcha\r\n        Captcha sama seperti mollom berguna untuk memblok spam yang masuk ke website kita.\r\n\r\n4. Modul SEO Drupal\r\n    •	SEO checklist\r\n        Sama halnya seperti security review, hanya memberi review tingkat optimasi SEO website drupal. Namun jika semua sarannya diterapkan maka jaminan Search Engine Optimization drupal kita akan semakin mumpuni.\r\n    •	Site verify\r\n        Memungkinkan verifikasi kepemilikan website kita bagi Search Engine. Bagi Anda yang mengerti struktur template drupal sebenarnya dapat menambahkan verifikasi ini ke bagian head secara manual, bagi yang tidak bisa pakai modul ini.\r\n    •	XML Sitemap\r\n        Membuat sitemap xml drupal kita secara lengkap dan otomatis sesuai kebutuhan. Bisa tambah custom URL dan pengiriman sitemap otomatis ke Search Engine.\r\n    •	Meta tag\r\n        Sesuai namanya memungkinkan kita menambahkan meta tag secara otomatis pada tiap halaman baik itu halaman depan, content, page, forum, user dan lain-lainnya dengan tag yang dapat disesuaikan. Support pula Metatag views, twitter card, open graph dll, wajib pake deh.\r\n    •	Path Auto\r\n        Modul yang mampu membuat alamat URL secara otomatis. Biasanya berdasarkan title / judul halaman tapi bisa di override dan kita sesuaikan semau kita.\r\n\r\n* Untuk mengoptimalkan database Drupal silahkan baca Optimasi Database Drupal via phpMyAdmin dan Onsite\r\n', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Instalasi Drupal\r\n\r\nSebelum menginstal drupal pastikan Anda sudah menginstall aplikasi pada komputernya berupa web servernya yaitu xampp. Xampp yang digunakan minimal adalah 1.7.0 dibawah itu tidak support untuk drupal 7. Instalasi yang dilakukan pada tutorial ini menggunakan drupal versi 712 berikut ini adalah cara menginstall drupal:\r\n\r\n1.	Extract file drupal 7.12 yang disediakan pada cd pendukung kedalam folder c:/xampp/htdocs sehingga menjadic:/xampp/htdocs/drupal-7.12 ( nama drupal-7.12 dapat diganti sesuai keinginan) sebagai contoh penulis merubah menjadi “c:/xampp/htdocs/drupal”\r\n\r\n2.	Ketikkan pada adressbar alamat drupal yaitu http:/localhost/drupal (disini penulis telah merubah nama folder drupal menjadi "drupal”)\r\n\r\n3.	Klik “Standard” kemudian klik tombol “Save and Continue”.\r\n\r\n4.	Selanjutnya gunakan default bahasa yaitu English dan klik tombol “Save and Continue”.\r\n\r\n5.	Sebelum mengisi Database konfigurasi kita harus membuat database terlebih dahulu pada phpmyadmin. Buka browser (disarankan gunakan Mozillla Firefox) ketikkan alamat localhost/phpmyadmin (pastikan xampp telah diaktifkan).\r\n \r\n6.	Klik Database, pada Create New Database, ketikkan nama database yang akan dibuat yaitu drupal ( Disini penulis mencontohkan drupal)\r\n \r\n7.	Klik “create” dan database berhasil dibuat, tinggalkan halaman phpmyadmin, sekarang kita kembali ke halaman instalasi drupal.\r\n\r\n8.	Lengkapi Database Configuration seperti berikut ini : \r\n\r\n•	Pilih Database MySQL, MariaDB, or equivalent\r\n•	Isikan Database Name =  drupal  ( Disini penulis mencontohkan Drupal)\r\n•	Database username = root\r\n•	Database password = “isi sesuai dengan password dari masing-masing webserver” disini penulis mengosongkan karena tidak menggunakan password.\r\n•	Klik “Save and Continue”.\r\n\r\n9.	Biarkan proses instalasi drupal berjalan.\r\n\r\n10.	Setelah Instalasi Complete, lengkapi data Configuration Site yaitu : \r\n•	Site Name		:  Isikan dengan nama website yang dibuat\r\n•	Site E-mail Address	:  Isi dengan alamat e-mail addres\r\n•	Username		:  Isi dengan username untuk Login Administrator\r\n•	E-mail Address	:  Isi dengan alamat e-mail address\r\n•	Password		:  Isi dengan password Administrator\r\n•	Confirm Password	:  Samakan datanya dengan Password\r\n•	Default Country	:  Pilih Negara yaitu Indonesia\r\n•	Default timezone	:  Pilih Asia/Jakarta\r\n\r\n11.	Klik “Save and Continue” proses instalasi drupal telah selesai, untuk menuju halaman drupal klik “Visit your New Site”.\r\n', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'PENGERTIAN DRUPAL\r\nDrupal adalah sebuah perangkat lunak system manajemen konten yang bebas dan terbuka yang di distribusikan dibawah lisensi GPL , Pengembangan dan perawatannya dilakukan oleh ribuan komunitas pengguna dan pengembang di seluruh dunia. Drupal dapat diunduh secara bebas dan dapat digunakan secara bebas juga, sehingga memungkinkan setiap orang baik secara idividu maupun komunitas untuk mempublikasi, mengatur dan mengorganisir berbagai jenis dari isi/konten pada untuk website.\r\n\r\ndrupal.web.id adalah situs web komunitas Drupal Indonesia. Menyediakan dokumentasi dan server terjemahan Drupal Bahasa Indonesia, juga forum diskusi untuk masalah instalasi penggunaan, modul, tema perwajahan (atau theme dan template).\r\n\r\n\r\nFUNGSI DRUPAL\r\nDrupal dapat digunakan untuk membangun:\r\n• Portal Web Komunitas\r\n• Situs Diskusi\r\n• Website Perusahaan\r\n• Aplikasi Internal\r\n• Website Personal atau Blog\r\n• Aplikasi Komersial E-commerce\r\n• Kumpulan Sumber Informasi\r\n• Situs Jaringan Sosial\r\n• Website Multi Bahasa\r\n• Dan lain-lain\r\n\r\nDrupal dapat langsung digunakan setelah anda mendownload dan menginstallnya secara mudah. Dengan berbagai fungsionalitas yang sudah dibangun, dikombinasikan dengan ribuan paket Modul drupal dan tema tampilan bebas yang tersedia, akan mengaktifkan berbagai fitur seperti :\r\n• Sistem Managemen Konten Content management system (CMS)\r\n• Blog\r\n• Forum\r\n• Jaringan peer to peer ( peer to peer networking )\r\n• Surat Kabar ( News letters )\r\n• Multimedia\r\n• Galeri Foto / Gambar ( picture gallery )\r\n• Pengunggahan dan Pengunduhan File (File uploads and downloads)\r\n• Dan lebih banyak lagi.\r\n\r\nDitulis dengan bahasa PHP Drupal jalan di atas berbagai system operasi Microsoft Windows, Mac OS X, linux, freeBSD dan lain-lain yang mendukung server web Apache membutuhkan program database seperti MySQL dan PostgSQL untuk menyimpan semua datanya.\r\nMeskipun menurut beberapa pengembang Drupal dibilang cukup sulit untuk pengguna baru, namun dengan berbagai keunggulannya, Drupal merupakan salah satu CMS terbaik.\r\n\r\nKONSEP DRUPAL\r\n• Node \r\nNode adalah satuan konten yang terdapat dalam Drupal. Sebuah node dapat merupakan blog, topik forum, berita, halaman statis, gambar, video, audio, maupun flash. Kumpulan node inilah yang membentuk keseluruhan konten dalam sebuah website berbasis Drupal.\r\n• Taxonomy\r\nNode yang begitu banyak perlu dikategorikan sesuai topik masing-masing. Dalam Drupal terdapat modul Taxonomy yang digunakan untuk mengkategorikan konten. Nama taxonomy diambil dari ilmu klasifikasi. Dengan demikian setiap satuan konten bisa disebutkan apakah berkategori Politik, Ekonomi, Sains, atau Agama. Cara mengklasifikasikan konten sepenuhnya diserahkan kepada pengguna yang punya hak untuk mengatur taksonomi. Modul-modul lain juga menggunakan modul Taxonomy untuk mengklasifikasikan konten tertentu, seperti misalnya Forum dan Image Gallery.\r\n• Comment\r\nComment merupakan tanggapan terhadap sebuah node yang dituliskan oleh user.\r\n• Menu\r\nSistem menu dalam drupal adalah sistem penanganan request melalui URL. Jika Clean URL tidak diaktifkan, maka setiap query string yang berbentuk ?q= akan ditangani oleh sistem menu.\r\n• Modul\r\nWebsite Drupal dapat ditambah dengan modul-modul tertentu sesuai keperluan. Modul adalah satuan program yang ditulis dalam PHP yang jika diaktifkan akan menambah fungsi tertentu. Misalnya modul Organic Groups untuk memberi fungsi group/mailing list seperti layaknya Google Groups ataupun Yahoo Groups. Modul Images untuk mengijinkan user mengupload gambar sebagai node.\r\n• Theme\r\nTheme adalah penampakan luar dari sebuah website Drupal. Sistem theme akan mengatur bagaimana website ditampilkan, layout halaman, penempatan block, style, dan sebagainya. Theme dapat diubah-ubah dengan memilih theme yang tersedia dalam direktori /themes maupun /sites/all/themes.\r\n• Hook. \r\nUser tidak pernah menyadari keberadaan konsep ini dalam Drupal, kecuali mereka adalah developer. Hook adalah metoda yang digunakan Drupal agar setiap modul dapat menambahkan fungsi tertentu, dengan cara mengaitkan fungsi tertentu tersebut pada hook yang dimiliki sistem Drupal. Sebagai contoh, setiap modul dapat menambah menu baru dengan cara mendefinisikan fungsi modul_menu, yang akan menjamin Drupal tidak lupa memperhitungkan keberadaan menu tersebut ketika diperlukan.\r\n\r\n', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'Universitas Muhammadiyah Surakarta atau yang biasa di singkat menjadi UMS ini merupakan lembaga pendidikan tinggi persyarikatan Muhammadiyah. UMS berdiri berdasarkan Surat Keputusan Menteri Pendidikan Kebudayaan RI No. 0330/0/1981 tanggal 24 Oktober 1981 sebagai perubahan bentuk dari IKIP Muhammadiyah Surakarta.\r\n\r\nAwalnya secara kelembagaan UMS berasal dari Fakultas Keguruan dan Ilmu Pendidikan (FKIP) Universitas Muhammadiyah Jakarta Cabang Surakarta yang didirikan pada tahun 1957. Perintisnya antara lain Ibu Sudalmiyah Suhud Rais, Bapak Radjab Bulan Hadipurnomo, Bapak Muhammad Syafa''at Habib, Ibu Sulastri Gito Atmodjo, dan KH Syahlan Rosyidi.\r\nPada tahun 1965, FKIP Muhammadiyah Cabang Surakarta mendapatkan ijin untuk berdiri sendiri dan menjadi dua lembaga Pendidikan Tinggi, yaitu Institut Keguruan dan Ilmu Pendidikan (IKIP) Muhammadiyah Surakarta, di bawah koordinasi Departemen Perguruan Tinggi dan Ilmu Pengetahuan dan Institut Agama Islam Muhammadiyah (IAIM) di bawah koordinasi Departemen Agama. IKIP Muhammadiyah Surakarta berdiri dengan jurusan-jurusan Pendidikan Umum (PU), Ekonomi Umum (EU) berdasarkan Surat Keputusan Menteri Perguruan tinggi dan Ilmu Pengetahuan No. 337/B-SWT/1965, dan IAIM dengan jurusan Tarbiyah/Pendidikan Agama Islam dan Jurusan Ushuluddin/Perbandingan Agama bersadarkan Keputusan Menteri Agama nomor 21 tahun 1966.\r\n\r\nPada tahun 1979, Drs. H. Mohamd Djazman, Rektor IKIP Muhammadiyah Surakarta saat itu, memprakarsai berdirinya Universitas Muhammadiyah Surakarta dengan menggabungkan IKIP Muhammadiyah Surakarta dan IAIM Surakarta. Prakarsa tersebut kemudian terwujud dengan turunnya SK Menteri Pendidikan dan Kebudayaan Nomor 0330/O/1981 tentang berubahnya status IKIP Muhammadiyah Surakarta menjadi Universitas Muhammadiyah Surakarta.\r\nSebagai pemantapan institusi, UMS mengelola beberapa fakultas, yaitu FKIP, Fakultas Ekonomi, Fakultas Hukum, Fakultas Teknik, dan Fakultas Agama Islam (FAI). Pada tahun 1983/1984, UMS menambah lagi Fakultas baru yaitu Fakultas Psikologi dan Fakultas Geografi. Sejalan dengan perkembangan zaman dan tuntutan dari masyarakat maka pada tahun Fakultas Ekonomi dengan Jurusan Ilmu Ekonomi Studi Pembangunan, Fakultas Teknik dengan Jurusan Teknik Arsitektur, Elektro, Teknik Kimia, dan Teknik Industri.\r\nTahun 1993/1994 UMS membuka program Pendidikan Ahli Madya Kesehatan (D3) dengan Jurusan Keperawatan, Fisioterapi, Gizi, dan Kesehatan Lingkungan. Tahun 1995/1996 membuka Program Pasca Sarjana dengan program Magister Studi Islam (MSI). Selanjutnya pada tahun 1999 membuka Fakultas Farmasi dan Magister Manajemen (MM) serta tahun 2001 membuka Magister Ilmu Hukum, Teknik Sipil, dan Manajemen Pendidikan. Pada tahun 2003/2004 dibuka program S1 dan D4 Fakultas Ilmu-Ilmu Kesehatan, dengan jurusan Kesehatan Masyarakat, Keperawatan, Fisioterapi, dan menyusul dibuka program studi Pendidikan Dokter tahun akademik 2004/2005.\r\n\r\nPada tahun 2005, UMS mendapat ijin untuk membuka program Magister Psikologi dan di susul program Magister Pengkajian Bahasa tahun 2006. Pada tahun 2006, FKIP membuka jurusan baru Program D2 Pendidikan Guru Taman Kanak-Kanak (PGTK) yang kemudian berkembang menjadi Program Studi Pendidikan Anak Usia Dini (PAUD) jenjang S1.\r\nTahun 2006 UMS juga membuka fakultas baru yaitu komunikasi dan informatika dengan jurusan pertama yaitu komunikasi dan tahun 2007 disusul oleh teknik informatika. Pada tahun 2007 FKIP juga membuka jurusan baru, yaitu Pendidikan Guru Sekolah Dasar (PGSD). Tahun 2007 juga ditandai dengan langkah UMS menuju universitas kelas dunia yaitu dengan dibukanya program Internasional kerjasama UMS dengan Kingston University di Inggris untuk program studi automotive engineering. Hingga saat ini, UMS mengelola 41 (empat puluh satu) program studi dan 4 (empat) Program Rintisan Standar Internasional. Keempat Program tersebut adalah Pendidikan Matematika, Pendidikan Akuntasi, Pendidikan Biologi, Program Studi Teknik Informatika, Program Studi Ekonomi Akuntansi dan program Studi Manajemen. Untuk Program Rintisan Standar Internasional program studi di pendidikian dimulai semester V sementara program studi non kependidikan dimulai sejak semester I. Di samping itu, UMS juga menyelenggarakan pendidikan profesi, seperti profesi Apoteker, Psikologi, Advokat, Ners, dan Guru. Landasan untuk menuju universitas kelas dunia semakin kuat dengan masuknya UMS dalam kelompok 50 Promissing Indonesian Universities menurut versi Dirjen Dikti tahun 2006. (Dyah Fiska Indriawati)\r\n', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, 'Finic lahir dengan nama pertama FIK (Fotografi Ilmu Komunikasi). Unit Kegiatan Mahasiswa (UKM) Ini sempat Vakum selama 2 tahun. Setelah Vakum Filantropi mengambil alih FIK namun setelah dipikir-pikir nama FIK kok sama dengan FIK (Fakultas Ilmu Kedokteran), terus FIK (Fotografi Ilmu komunikasi) berevolusi dengan mengadakan sayembara nama untuk menggantikan nama FIK. Fauzan selaku ketua FIK mengusulkan nama FINIC (Fotografi ilmu komunikasi dan informatika Club) yang disepakati oleh semua anggota FINIC dan dicetuskan di bulan desember 2008.\r\n\r\n FINIC sebagai sebuah UKM yang bernaung di bawah BEM yang memiliki agenda rutin setiap sabtu untuk mendalami materi-materi mengenai fotografi. Selain hari sabtu dilain waktu angota-angota yang ingin belajar mendalami fotografi bisa mendatangani mentor-mentor yang berada di kost atau mengadakan perjanjian dimana untuk melakukan pembelajaran fotografi. Dalam UKM FINIC semua anggota memiliki  hak yang sama, cuma di UKM tersebut menuntut loyalitas yang tinggi untuk para anggotanya supaya bertanggung jawab kepada dirinya sendiri dan UKM yang diembannya.\r\n\r\nPrestasi FINIC yang diraih selama mengibarkan sayapnya di dunia fotografi telah pernah merebut juara foto model di Hotel Dana dengan fotografernya saudara Dana, juara fotografi Darwis Triadi di Diamond Center, juara Blue Print tingkat Jawa Tengah yang diwakili oleh Aldila.\r\nDalam rangka HUT UMS, FINIC sebagai CEO-nya UMS untuk membuat pameran di Pura Mangkunegaran dan melakukan pameran hasil-hasil karya UKM FINIC di lingkup kampus. UKM ini memiliki peralatan yang cukup lengkap dengan memiliki soft box sendiri, meliki frem 40 frem, memiliki background untuk foto wisuda dan memiliki beberapa kamera.\r\nDi UKM FINIC tersendiri para anggota dilepas dengan tujuan agar para anggota FINIC berkreasi dalam menciptakan hasil-hasil karya fotografinya. (Ari Prasetyo Utomo & Andika Fajar Novianto)\r\n', '', 'filtered_html'),
('node', 'article', 0, 8, 8, 'und', 0, ' Hal tersebut terungkap dari riset global yang dilakukan Quacquarelli Symonds (QS) dengan tajuk QS World University Rankings. QS memeringkat 3.539 perguruan tinggi di seluruh dunia dan menyusun peringkat 891 perguruan tinggi dunia.\r\n \r\nSecara global, Universitas Indonesia (UI) menempati peringkat 358 dari total 891 pergurun tinggi. Di Indonesia, UI menempati peringkat pertama disusul ITB, UGM, Unair, IPB, Undip, ITS, UMS, dan Unibraw.\r\n \r\n"Ada 9 universitas yang masuk peringkat 891 dunia, bertambah satu universitas dibandingkan tahun lalu. Universitas Indonesia  masih memimpin klasemen, kendati  beberapa indikatornya mengalamai penurunan," tulis siaran pers QS.\r\n \r\nUniversitas Muhammadiyah Surakarta merupakan satu-satunya perguruan tinggi swasta yang berada di daftar tersebut. Daftar yang dibuat tahunan oleh QS itu menyuratkan bahwa UMS adalah universitas terbaik ke-8 di Indonesia, universitas terbaik ke-2 di Jawa Tengah, sekaligus perguruan tinggi swasta terbaik di Indonesia. Untuk tahun 2015/16. \r\n \r\nSemoga prestasi ini dapat dipertahankan dan dinaikkan di masa-masa mendatang.\r\n', '', 'filtered_html');
