(1, 'node', ' istilah penting dalam drupal node content node merupakan isi dari sebuah website yang dibangun menggunakan drupal jenis isi website bisa bervariasi seperti blog topik forum gambar dan artikel sebagai contoh apabila kita membuat website berita online maka berita foto galeri forum diskusi poling disebut node entity type istilah ini sering digunakan sejak drupal 7 entity type semacam wadah untuk menggabungkan beberapa field entity type berguna untuk menyimpan dan menampilkan data yang bisa berupa node taxonomy term user profile atau jenis custom content lainnya comment comment salah satu jenis content type bawaan dari drupal setiap comment berupa posting tulisan dari user yang tergabung dalam sebuah node sebagai contoh user dapat memposting comment di sebuah topik forum taxonomy taxonomy merupakan sistem pembagian jenis konten website module taxonomy merupakan bawaan dari drupal anda dapat menentukan vocabulary wadah dari taxonomy term dan menambahkan sejumlah term di vocabulary setiap vocabulary dapat dipasangkan pada content type sehingga node dapat dikelompokkan per kategori sesuai keinginan anda contoh sebuah portal berita anda dapat membuat vocabulary topik berita kemudian dalam vocabulary topik berita tersebut dapat diisi term politik olahraga teknologi dst selanjutnya dalam entity type berita dapat ditambahkan vocabulary topik berita sehingga pada saat kita memposting sebuah berita kita dapat memilih berita tersebut masuk dalam kategori politik olahraga teknologi user user merupakan entity yang mewakili pengguna website setting awal user terdiri dari username password role dan alamat email tetapi kita dapat menambahkan field baru dengan mengaktifkan modul tambahan seperti menambahkan link social network fb twitter module module adalah kode program yang melengkapi fungsi dari drupal module terdiri dari 3 kategori core module adalam module bawaan pada waktu kita mendownload drupal seperti blog poll book atau taxonomy contributed module adalah module yang dikembangkan dan dibuat oleh komunitas drupal kita dapat mendownload dan menginstall di website kita seperti panel views pathauto custom module bagi anda yang sudah terbiasa menggunakan bahasa pemrograman dan mengerti alur dari drupal dan drupal api region halaman website drupal disusun dalam area yang disebut region didalamnya terdapat header footer sidebar dan maincontent selain itu anda dapat menambahkan region sesuai kebutuhan website anda block block adalah bagianbagian kecil informasi yang diletakkan dalam region block dapat berisi berbagai macam konten seperti form tulisan gambar dan script selain itu block juga bisa berupa bagian dari module seperti most comment block dari module comment who s online block dari core module drupal new topic block dari module forum block juga dapat menampilkan konten yang dinamis seperti upcoming event top score menu menu berguna untuk mengarahkan user ke konten website terdapat 4 jenis menu di drupal 7 main menu dibuat oleh administrator dan ditampilkan secara otomatis di header website apabila tidak tampil bisa anda aktifkan di block management menu adalah menu untuk administrasi website ditampilkan di toolbar admin navigation menu berisi semua link menu yang berhubungan dengan module di website anda user menu berisi link ke user account dan logout selain keempat menu tersebut anda dapat membuat menu baru dan menampilkannya di region yang anda inginkan anda dapat mengkustomisasi menu dengan berbagai cara seperti mengurutkan mengubah nama menu mengganti link menu dan tooltip menu selain itu juga dapat mengatur parent pada menu item menu juga memiliki hak akses seperti contoh admin menu hanya bisa dilihat oleh administrator bukan oleh user biasa theme thema mengatur tampilan di website anda bagaimana design website anda akan tampil seperti tampilan gambar layout dan warna theme terdiri dari beberapa file php yang akan menampilkan output html di halaman website beserta file css yang mengatur layout font warna dan style lainnya theme dapat diubahubah dengan memilih theme yang tersedia dalam direktori themes maupun sites all themes views meskipun tidak semua website menggunakan module views tetapi hampir sebagian besar website menyertakan views module karena fungsinya yang sangat pengint views dapat mengambil list node atau entity kemudian menampilkannya dalam berbagai bentuk format halaman block rss feed atau format lainnya kegunaan utama dari views adalah mengambil dan menampilkan content list secara dinamis seperti contoh latest news di portal berita database database sebagai media penyompan informasi dengan database setiap informasi ditampung dalam table sebagai contoh informasi yang anda posting dalam node akan tersimpan dalam table node dan setiap fieldnya tersimpan dalam table yang terpisah drupal membuatnya secara otomatis comment dan user juga memiliki table tersendiri sesuai role dan permissionnya database yang paling umum digunakan di drupal adalah mysql meskipun drupal juga mendukung system database yang lain path saat anda mengunjungi website drupal alamat url website itu yang dinamakan path secara umum drupal menggunakan format namadomaincom node 1 selain itu kita dapat menggunakan module tambahan seperti pathauto untuk mengubah format url sesuai format yang kita inginkan url menggunakan pathauto mudah dibaca dan sangat efektif hook user tidak pernah menyadari keberadaan konsep ini dalam drupal kecuali mereka adalah developer hook adalah metoda yang digunakan drupal agar setiap modul dapat menambahkan fungsi tertentu dengan cara mengaitkan fungsi tertentu tersebut pada hook yang dimiliki sistem drupal sebagai contoh setiap modul dapat menambah menu baru dengan cara mendefinisikan fungsi modulmenu yang akan menjamin drupal tidak lupa memperhitungkan keberadaan menu tersebut ketika diperlukan administer tempat pengaturan semua fungsi kerja drupal input format text format untuk versi d7 menu untuk mengatur format dari teks html yang akan kita tampilkan pada konten node permissions hak akses yang dimiliki user roles untuk membatasi kewenangan aksi terhadapsuatu konten modul tema atau fungsi situs lainnya roles kelompok user yang mempunyai permission yang sama content type book page blog story forum body isi dari konten secara full teaser isi ringkasan dari konten biasanya diambil sejumlah xxx karakter dari isi awal konten dengan xxx panjang karakternya misalnya 300 400 900 dan nilau defaultnya adalah 600 field field adalah bagian dari suatu struktur content tempat menyimpan suatu data data yang disimpan ini bisa berupa tulisan angka image audio atau video setiap jenis content pada drupal memiliki jumlah field dan jenis data yang berbedabeda bahkan bisa dikembangkan sesuai dengan kebutuhan kita drupal istilahistilah node entity comment dsb ', 0),
(2, 'node', ' kelebihan kekurangan drupal kelebihan drupal 1 drupal bersifat open source yang bisa digunakan secara personal maupun group untuk mengatur berbagai jenis content drupal dapat digunakan sebagai web portal situs diskusi situs perusahaan bahkan blog dan aplikasi ecommerce drupal memiliki fungsi bulitin dan modulmodul eksternal yang dapat langsung didownload gratis dari situsnya 2 drupal didesain sebagai sebuah publishing system cms kelebihan drupal terutama dalam hal taksonomi taksonomi adalah ilmu tentang klasifikasi yang dalam hal ini berarti pengklasifikasian content yang bagus dalam sebuah website konsep taxonomy dalam drupal terkenal sangat flekzibel dan powerfull ditambah dengan konsep node dimana setiap node dapat berupa pages stories blog item files atau apapun yg berhubungan dgn konten itu sendiri inilah alasan kenapa drupal sangat cocok dan tepat digunakan untuk situs2 yang mengandalkan konten sebagai nilai jual dan pengelompokan artikel yg komplek seperti situs portal berita artikel knowledgebase kolaborasi dsb 3 drupal memiliki dua konsep perkembangan yaitu modular dan extensible drupal menggunakan system block atau module yang dapat menambah fitur dari sebuah website drupal juga mensupport standard programming seperti css dan xhtml 4 dukungan database drupal meminimalisasikan query database dan penggunaan resource juga memperluas persyaratan server sehingga mempermudah penginstallan drupal dapat beroperasi pada server yang menggunakan apache server platform php dan mysql postgresql database meski demikian drupal menyediakan path freeware untuk menjalankan drupal dengan menggunakan ms sql 5 kemudahan instalasi drupal sudah menyediakan instalasi dengan menggunakan fantastico untuk instlasi manual memang agak repot karena kita harus membuat databasenya terlebih dahulu selain itu untuk proses create tabeltabelnya juga harus dijalankan secara manual tapi ini hanya berlaku di drupal versi 4 sedangkan drupal 50 sudah menggunakan web based installati