(3, 'node', ' 4 jenis modul penting drupal yang perlu dipakai dan kegunaannya modul drupal terbagi menjadi 4 jenis sesuai fungsi dan manfaatnya guna optimasi seo drupal optimasi security drupal optimasi design dan tampilan serta modul pelengkap core modul bawaan drupal adalah salah satu cms yang lengkap dan multi fungsi namun bukan berarti cms ini sudah sempurna pada kenyataannya cms ini harus memasang modul tambahan dan sebaliknya menonaktifkan module yang tidak diperlukan penting untuk diingat salah satu bagian dari optimasi website berbasis drupal adalah bijaksana artinya hanya memakai module dan resource yang diperlukan dan membuang yang kurang bermanfaat aplikasi nyatanya adalah jika anda tidak akan menggunakan forum di situs drupal anda maka tidak ada untungnya memasang modul tersebut anda juga dapat mempertimbangkan modulmodul seperti openid books testing overlay blog dan lainlain berikut adalah 4 tipe modul penting drupal yang perlu anda pakai dan kegunaannya 1 modul basic modul basic atau modul dasar yang saya maksudkan di sini adalah selain module core tapi memiliki fungsi dan kegunaan yang sangat besar serta menyempurnakan mesin drupal views ini adalah salah satu modul drupal terbaik memiliki kemampuan untuk membuat list dan query custom dari database views juga menyempurnakan modul bawaan seperti taxonomy term glosary tracker users dan lainlain lebih dari itu views dapat digunakan untuk membuat content custom salah satu content yang paling populer adalah views slideshow ctools chaos tools paket modul oleh merlin of chaos yang dibutuhkan oleh begitu banyak modul agar berjalan seperti oleh views meta tags quick tabs bulk export dan lainlain cck pada dasarnya adalah modul miscelleneous serbaserbi tapi faktany user interface token api dan memudahkan kita melihat semua daftar token dari database yang dipakai situs kita jelas ini akan mempermudah kita dalam membuat dan mengenali field dalam database libraries memungkinkan menggunakan library external non core 