(4, 'node', ' instalasi drupal instalasi drupal sebelum menginstal drupal pastikan anda sudah menginstall aplikasi pada komputernya berupa web servernya yaitu xampp xampp yang digunakan minimal adalah 170 dibawah itu tidak support untuk drupal 7 instalasi yang dilakukan pada tutorial ini menggunakan drupal versi 712 berikut ini adalah cara menginstall drupal 1 extract file drupal 712 yang disediakan pada cd pendukung kedalam folder c xampp htdocs sehingga menjadic xampp htdocs drupal712 nama drupal712 dapat diganti sesuai keinginan sebagai contoh penulis merubah menjadi c xampp htdocs drupal 2 ketikkan pada adressbar alamat drupal yaitu http localhost drupal disini penulis telah merubah nama folder drupal menjadi drupal 3 klik standard kemudian klik tombol save and continue 4 selanjutnya gunakan default bahasa yaitu english dan klik tombol save and continue 5 sebelum mengisi database konfigurasi kita harus membuat database terlebih dahulu pada phpmyadmin buka browser disarankan gunakan mozillla firefox ketikkan alamat localhost phpmyadmin pastikan xampp telah diaktifkan 6 klik database pada create new database ketikkan nama database yang akan dibuat yaitu drupal disini penulis mencontohkan drupal 7 klik create dan database berhasil dibuat tinggalkan halaman phpmyadmin sekarang kita kembali ke halaman instalasi drupal 8 lengkapi database configuration seperti berikut ini pilih database mysql mariadb or equivalent isikan database name drupal disini penulis mencontohkan drupal database username root database password isi sesuai dengan password dari masingmasing webserver disini penulis mengosongkan karena tidak menggunakan password klik save and continue 9 biarkan proses instalasi drupal berjalan 10 setelah instalasi complete lengkapi data configuration site yaitu site name isikan dengan nama website yang dibuat site email address isi dengan alamat email addres username isi dengan username untuk login administrator email address isi dengan alamat email address password