(5, 'node', ' pengertian drupal pengertian drupal drupal adalah sebuah perangkat lunak system manajemen konten yang bebas dan terbuka yang di distribusikan dibawah lisensi gpl pengembangan dan perawatannya dilakukan oleh ribuan komunitas pengguna dan pengembang di seluruh dunia drupal dapat diunduh secara bebas dan dapat digunakan secara bebas juga sehingga memungkinkan setiap orang baik secara idividu maupun komunitas untuk mempublikasi mengatur dan mengorganisir berbagai jenis dari isi konten pada untuk website drupalwebid adalah situs web komunitas drupal indonesia menyediakan dokumentasi dan server terjemahan drupal bahasa indonesia juga forum diskusi untuk masalah instalasi penggunaan modul tema perwajahan atau theme dan template fungsi drupal drupal dapat digunakan untuk membangun portal web komunitas situs diskusi website perusahaan aplikasi internal website personal atau blog aplikasi komersial ecommerce kumpulan sumber informasi situs jaringan sosial website multi bahasa dan lainlain drupal dapat langsung digunakan setelah anda mendownload dan menginstallnya secara mudah dengan berbagai fungsionalitas yang sudah dibangun dikombinasikan dengan ribuan paket modul drupal dan tema tampilan bebas yang tersedia akan mengaktifkan berbagai fitur seperti sistem managemen konten content management system cms blog forum jaringan peer to peer peer to peer networking surat kabar news letters multimedia galeri foto gambar picture gallery pengunggahan dan pengunduhan file file uploads and downloads dan lebih banyak lagi ditulis dengan bahasa php drupal jalan di atas berbagai system operasi microsoft windows mac os x linux freebsd dan lainlain yang mendukung server web apache membutuhkan program database seperti mysql dan postgsql untuk menyimpan semua datanya meskipun menurut beberapa pengembang drupal dibilang cukup sulit untuk pengguna baru namun dengan berbagai keunggulannya drupal merupakan salah satu cms terbaik konsep drupal node node adalah satuan konten yang terda