(6, 'node', ' sejarah universitas muhammadiyah surakarta ums  universitas muhammadiyah surakarta atau yang biasa di singkat menjadi ums ini merupakan lembaga pendidikan tinggi persyarikatan muhammadiyah ums berdiri berdasarkan surat keputusan menteri pendidikan kebudayaan ri no 33001981 tanggal 24 oktober 1981 sebagai perubahan bentuk dari ikip muhammadiyah surakarta awalnya secara kelembagaan ums berasal dari fakultas keguruan dan ilmu pendidikan fkip universitas muhammadiyah jakarta cabang surakarta yang didirikan pada tahun 1957 perintisnya antara lain ibu sudalmiyah suhud rais bapak radjab bulan hadipurnomo bapak muhammad syafa at habib ibu sulastri gito atmodjo dan kh syahlan rosyidi pada tahun 1965 fkip muhammadiyah cabang surakarta mendapatkan ijin untuk berdiri sendiri dan menjadi dua lembaga pendidikan tinggi yaitu institut keguruan dan ilmu pendidikan ikip muhammadiyah surakarta di bawah koordinasi departemen perguruan tinggi dan ilmu pengetahuan dan institut agama islam muhammadiyah iaim di bawah koordinasi departemen agama ikip muhammadiyah surakarta berdiri dengan jurusanjurusan pendidikan umum pu ekonomi umum eu berdasarkan surat keputusan menteri perguruan tinggi dan ilmu pengetahuan no 337 bswt 1965 dan iaim dengan jurusan tarbiyah pendidikan agama islam dan jurusan ushuluddin perbandingan agama bersadarkan keputusan menteri agama nomor 21 tahun 1966 pada tahun 1979 drs h mohamd djazman rektor ikip muhammadiyah surakarta saat itu memprakarsai berdirinya universitas muhammadiyah surakarta dengan menggabungkan ikip muhammadiyah surakarta dan iaim surakarta prakarsa tersebut kemudian terwujud dengan turunnya sk menteri pendidikan dan kebudayaan nomor 330 o 1981 tentang berubahnya status ikip muhammadiyah surakarta menjadi universitas muhammadiyah surakarta sebagai pemantapan institusi ums mengelola beberapa fakultas yaitu fkip fakultas ekonomi fakultas hukum fakultas teknik dan fakultas agama islam fai pada tahun 19831984 ums menambah lagi fakultas baru yaitu fakultas psikologi dan fakultas geografi sejalan dengan perkembangan zaman dan tuntutan dari masyarakat maka pada tahun fakultas ekonomi dengan jurusan ilmu ekonomi studi pembangunan fakultas teknik dengan jurusan teknik arsitektur elektro teknik kimia dan teknik industri tahun 19931994 ums membuka program pendidikan ahli madya kesehatan d3 dengan jurusan keperawatan fisioterapi gizi dan kesehatan lingkungan tahun 19951996 membuka program pasca sarjana dengan program magister studi islam msi selanjutnya pada tahun 1999 membuka fakultas farmasi dan magister manajemen mm serta tahun 2001 membuka magister ilmu hukum teknik sipil dan manajemen pendidikan pada tahun 20032004 dibuka program s1 dan d4 fakultas ilmuilmu kesehatan dengan jurusan kesehatan masyarakat keperawatan fisioterapi dan menyusul dibuka program studi pendidikan dokter tahun akademik 20042005 pada tahun 2005 ums mendapat ijin untuk membuka program magister psikologi dan di susul program magister pengkajian bahasa tahun 2006 pada tahun 2006 fkip membuka jurusan baru program d2 pendidikan guru taman kanakkanak pgtk yang kemudian berkembang menjadi program studi pendidikan anak usia dini paud jenjang s1 tahun 2006 ums juga membuka fakultas baru yaitu komunikasi dan informatika dengan jurusan pertama yaitu komunikasi dan tahun 2007 disusul oleh teknik informatika pada tahun 2007 fkip juga membuka jurusan baru yaitu pendidikan guru sekolah dasar pgsd tahun 2007 juga ditandai dengan langkah ums menuju universitas kelas dunia yaitu dengan dibukanya program internasional kerjasama ums dengan kingston university di inggris untuk program studi automotive engineering hingga saat ini ums mengelola 41 empat puluh satu program studi dan 4 empat program rintisan standar internasional keempat program tersebut adalah pendidikan matematika pendidikan akuntasi pendidikan biologi program studi teknik informatika program studi ekonomi akuntansi dan program studi manajemen untuk program rintisan standar internasional program studi di pendidikian dimulai semester v sementara program studi non kependidikan dimulai sejak semester i di samping itu ums juga menyelenggarakan pendidikan profesi seperti profesi apoteker psikologi advokat ners dan guru landasan untuk menuju universitas kelas dunia semakin kuat dengan masuknya ums dalam kelompok 50 promissing indonesian universities menurut versi dirjen dikti tahun 2006 dyah fiska indriawati  ', 0),
(7, 'node', ' finic ukm fotografi ilmu komunikasi  finic lahir dengan nama pertama fik fotografi ilmu komunikasi unit kegiatan mahasiswa ukm ini sempat vakum selama 2 tahun setelah vakum filantropi mengambil alih fik namun setelah dipikirpikir nama fik kok sama dengan fik fakultas ilmu kedokteran terus fik fotografi ilmu komunikasi berevolusi dengan mengadakan sayembara nama untuk menggantikan nama fik fauzan selaku ketua fik mengusulkan nama finic fotografi ilmu komunikasi dan informatika club yang disepakati oleh semua anggota finic dan dicetuskan di bulan desember 2008 finic sebagai sebuah ukm yang bernaung di bawah bem yang memiliki agenda rutin setiap sabtu untuk mendalami materimateri mengenai fotografi selain hari sabtu dilain waktu angotaangota yang ingin belajar mendalami fotografi bisa mendatangani mentormentor yang berada di kost atau mengadakan perjanjian dimana untuk melakukan pembelajaran fotografi dalam ukm finic semua anggota memiliki hak yang sama cuma di ukm tersebut menuntut loyalitas yang tinggi untuk para anggotanya supaya bertanggung jawab kepada dirinya sendiri dan ukm yang diembannya prestasi finic yang diraih selama mengibarkan sayapnya di dunia fotografi telah pernah merebut juara foto model di hotel dana dengan fotografernya saudara dana juara fotografi darwis triadi di diamond center juara blue print tingkat jawa tengah yang diwakili oleh aldila dalam rangka hut ums finic sebagai ceonya ums untuk membuat pameran di pura mangkunegaran dan melakukan pameran hasilhasil karya ukm finic di lingkup kampus ukm ini memiliki peralatan yang cukup lengkap dengan memiliki soft box sendiri meliki frem 40 frem memiliki background untuk foto wisuda dan memiliki beberapa kamera di ukm finic tersendiri para anggota dilepas dengan tujuan agar para anggota finic berkreasi dalam menciptakan hasilhasil karya fotografinya ari prasetyo utomo andika fajar novianto  ', 1452761239),
(8, 'node', ' ums universitas terbaik ke8 di indonesia hal tersebut terungkap dari riset global yang dilakukan quacquarelli symonds qs dengan tajuk qs world university rankings qs memeringkat 3539 perguruan tinggi di seluruh dunia dan menyusun peringkat 891 perguruan tinggi dunia secara global universitas indonesia ui menempati peringkat 358 dari total 891 pergurun tinggi di indonesia ui menempati peringkat pertama disusul itb ugm unair ipb undip its ums dan unibraw ada 9 universitas yang masuk peringkat 891 dunia bertambah satu universitas dibandingkan tahun lalu universitas indonesia masih memimpin klasemen kendati beberapa indikatornya mengalamai penurunan tulis siaran pers qs universitas muhammadiyah surakarta merupakan satusatunya perguruan tinggi swasta yang berada di daftar tersebut daftar yang dibuat tahunan oleh qs itu menyuratkan bahwa ums adalah universitas terbaik ke8 di indonesia universitas terbaik ke2 di jawa tengah sekaligus perguruan tinggi swasta terbaik di indonesia untuk tahun 201516 semoga prestasi ini dapat dipertahankan dan dinaikkan di masamasa mendatang  ', 0);
